      <div id="pic1">
        <h3>1</h3>
      </div>
      <div id="pic2">
        <h3>2</h3>
      </div>
      <div id="pic3">
        <h3>3</h3>
      </div>
      <div id="pic4">
        <h3>4</h3>
      </div>
    </Carousel>
  </div>
  );
};

export default Slider;
